Insert into DB_SAWEE.BOARD_WRITE (BW_NO,M_NO,BT_NO,S_NO,BW_TITLE,BW_CONTENT,BW_WRITTEN_DATE,BW_UPDATED_DATE,BW_HIT,BW_RECOMMEND_NUM,BW_REPORT_NUM,BW_ISLAND,BW_SECRET) values (344,0,12,35,'무인도 게시판에 관한 공지입니다.','<p>국가는 균형있는 국민경제의 성장 및 안정과 적정한 소득의 분배를 유지하고, 시장의 지배와 경제력의 남용을 방지하며, 경제주체간의 조화를 통한 경제의 민주화를 위하여 경제에 관한 규제와 조정을 할 수 있다. 국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다.</p><p>법원은 최고법원인 대법원과 각급법원으로 조직된다. 정부는 회계연도마다 예산안을 편성하여 회계연도 개시 90일전까지 국회에 제출하고, 국회는 회계연도 개시 30일전까지 이를 의결하여야 한다. 형사피고인은 유죄의 판결이 확정될 때까지는 무죄로 추정된다. 제2항과 제3항의 처분에 대하여는 법원에 제소할 수 없다.</p><p>대통령은 헌법과 법률이 정하는 바에 의하여 국군을 통수한다. 대통령의 임기가 만료되는 때에는 임기만료 70일 내지 40일전에 후임자를 선거한다. 제1항의 탄핵소추는 국회재적의원 3분의 1 이상의 발의가 있어야 하며, 그 의결은 국회재적의원 과반수의 찬성이 있어야 한다. 다만, 대통령에 대한 탄핵소추는 국회재적의원 과반수의 발의와 국회재적의원 3분의 2 이상의 찬성이 있어야 한다.</p>',to_date('20/04/16','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),2,0,0,0,'n');
