Insert into DB_SAWEE.BOARD_WRITE (BW_NO,M_NO,BT_NO,S_NO,BW_TITLE,BW_CONTENT,BW_WRITTEN_DATE,BW_UPDATED_DATE,BW_HIT,BW_RECOMMEND_NUM,BW_REPORT_NUM,BW_ISLAND,BW_SECRET) values (369,0,12,35,'글 작성에 관한 공지사항입니다. ','<p>게시판에는 해당 게시판과 관련있는 글만 작성 할 수 있습니다.</p><p>이에 어긋나는 경우, 무인도에 갈 수 있으니 조심하세요..</p>',to_date('20/04/18','RR/MM/DD'),to_date('20/04/18','RR/MM/DD'),5,0,0,0,'n');
Insert into DB_SAWEE.BOARD_WRITE (BW_NO,M_NO,BT_NO,S_NO,BW_TITLE,BW_CONTENT,BW_WRITTEN_DATE,BW_UPDATED_DATE,BW_HIT,BW_RECOMMEND_NUM,BW_REPORT_NUM,BW_ISLAND,BW_SECRET) values (346,0,12,35,'게시글 작성에 관한 공지입니다.','<p>법률이 정하는 주요방위산업체에 종사하는 근로자의 단체행동권은 법률이 정하는 바에 의하여 이를 제한하거나 인정하지 아니할 수 있다. 국회의원은 국가이익을 우선하여 양심에 따라 직무를 행한다. 국가는 국민 모두의 생산 및 생활의 기반이 되는 국토의 효율적이고 균형있는 이용·개발과 보전을 위하여 법률이 정하는 바에 의하여 그에 관한 필요한 제한과 의무를 과할 수 있다. 행정권은 대통령을 수반으로 하는 정부에 속한다. 국정의 중요한 사항에 관한 대통령의 자문에 응하기 위하여 국가원로로 구성되는 국가원로자문회의를 둘 수 있다. 모든 국민은 그 보호하는 자녀에게 적어도 초등교육과 법률이 정하는 교육을 받게 할 의무를 진다.</p><p>모든 국민은 자기의 행위가 아닌 친족의 행위로 인하여 불이익한 처우를 받지 아니한다. 국민의 자유와 권리는 헌법에 열거되지 아니한 이유로 경시되지 아니한다. 의무교육은 무상으로 한다. 모든 국민은 근로의 권리를 가진다. 국가는 사회적·경제적 방법으로 근로자의 고용의 증진과 적정임금의 보장에 노력하여야 하며, 법률이 정하는 바에 의하여 최저임금제를 시행하여야 한다. 탄핵결정은 공직으로부터 파면함에 그친다. 그러나, 이에 의하여 민사상이나 형사상의 책임이 면제되지는 아니한다. 국교는 인정되지 아니하며, 종교와 정치는 분리된다. 제1항의 탄핵소추는 국회재적의원 3분의 1 이상의 발의가 있어야 하며, 그 의결은 국회재적의원 과반수의 찬성이 있어야 한다. 다만, 대통령에 대한 탄핵소추는 국회재적의원 과반수의 발의와 국회재적의원 3분의 2 이상의 찬성이 있어야 한다.</p><p>국회의원은 법률이 정하는 직을 겸할 수 없다. 국가는 전통문화의 계승·발전과 민족문화의 창달에 노력하여야 한다. 모든 국민은 종교의 자유를 가진다. 헌법재판소의 조직과 운영 기타 필요한 사항은 법률로 정한다. 법률이 헌법에 위반되는 여부가 재판의 전제가 된 경우에는 법원은 헌법재판소에 제청하여 그 심판에 의하여 재판한다. 국가는 노인과 청소년의 복지향상을 위한 정책을 실시할 의무를 진다. 공공필요에 의한 재산권의 수용·사용 또는 제한 및 그에 대한 보상은 법률로써 하되, 정당한 보상을 지급하여야 한다. 대법원장은 국회의 동의를 얻어 대통령이 임명한다. 법원은 최고법원인 대법원과 각급법원으로 조직된다.</p>',to_date('20/04/16','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),0,0,0,0,'n');
