Insert into DB_SAWEE.BOARD_WRITE (BW_NO,M_NO,BT_NO,S_NO,BW_TITLE,BW_CONTENT,BW_WRITTEN_DATE,BW_UPDATED_DATE,BW_HIT,BW_RECOMMEND_NUM,BW_REPORT_NUM,BW_ISLAND,BW_SECRET) values (567,12,8,28,'문의 드립니다','<p><span style="color:rgb(33,37,41);">다른 보드워게임과 다른 Absolute Victory의 가장 큰 특징은 전투 방식과 이벤트입니다. 여타 보드워게임들은 보통 전투가 벌어지면 각 유닛들의 전투력과 전투력에 보정되는 값을 합산하고, 그것을 기준으로 주사위를 굴려서 적에게 줄 피해량을 결정합니다. 하지만 이 게임은 그렇게 간단하게 전투가 끝나지 않고, 전투에 영향을 미치는 다양한 선택과 전력 투사를 통해 전투를 진행합니다. 한 스택(유닛들의 모음)이 적 스택이 존재하는 헥스(=도시, 공장, 숲, 사막 등)로 진입하면 전투가 벌어집니다. 전투가 벌어지면 먼저 각자의 스택에 있는 병력을 전선에 배치하고, 남은 병력을 예비대(후방)로 배치합니다. 전선은 총 12칸으로 구성되어 있으며, 사령부와 전차는 1칸을 차지하고 보병은 2칸을 차지합니다. 스택에 아무리 병력이 많아도 전투에 참여할 수 있는 병력은 오직 전선에 배치된 병력 뿐입니다. 이러한 전선 너비는 이론</span></p>',to_date('20/04/21','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),11,0,0,0,'n');
