Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (12,116,3,'평일 모임(174번째) 후기 ','<p>1. 비아 네뷸라</p><p>에이지 오브 스팀을 만든 마틴왈레스의 가벼운 픽업앤딜리버리 게임입니다.</p><p>귀욤귀욤한 미플들이 매우 매력적이죠.</p><p>&nbsp;</p><figure class="image"><img src="http://boardlife.co.kr/wys2/swf_upload/2020/04/20/15873573281995.jpg"></figure><p><br>&nbsp;</p><p>&nbsp;</p><p>2. 마이스타</p><p>3라운드에 걸쳐 게이샤들이 많은 손님 받고 돈버는 게임입니다. 개인적으로는 와이어트 어프와 느낌이 매우 유사하게 느껴집니다.</p><p><br>&nbsp;</p><figure class="image"><img src="http://boardlife.co.kr/wys2/swf_upload/2020/04/20/15873573285589.jpg"></figure><p><br>&nbsp;</p><p>&nbsp;</p><p>3. 마스크맨</p><p>복면가왕이 생각나는 프로레슬러를 테마로 한 클라이밍 게임입니다.</p>',to_date('20/04/01','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),15,0,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (14,116,6,'카페리뷰올시다','<p>13ㅎㅁㅎㅁㅎㄴㅇㄹㅎㄴㅇㅎㄹㅇㄴㅎㅇㅁㄹ</p>',to_date('20/04/01','RR/MM/DD'),to_date('20/04/01','RR/MM/DD'),11,0,0,2,11);
