Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (101,12,2,'여기 겨울에도 너무 더워요','<p>테이블은 적은데 의자는 너무 많고</p><p>여름에도 덥고 겨울에도 덥고</p>',to_date('20/04/21','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),25,2,1,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (81,12,3,'카페에 다녀왔습니다!','<p>ㅁㄴㅇㄹ</p>',to_date('20/04/14','RR/MM/DD'),to_date('20/04/14','RR/MM/DD'),184,0,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (103,12,12,'후기입니다.','<p>게임의 룰은 무척 간단합니다. 저런 개인판에다가 타일을 하나하나 놓아나가는 게임이죠.</p><p>&nbsp;</p><p>내 턴이 되면 핸드에 있는 타일 중 하나를 골라서 놓고, 새로운 타일을 하나 가져오면 됩니다. 참 쉽죠?</p><p>&nbsp;</p><figure class="image"><img src="https://cf.geekdo-images.com/imagepage/img/XhEH1QVIGjKOliftoaOYul23co0=/fit-in/900x600/filters:no_upscale()/pic4956783.jpg" alt="Nearly completed quilt"></figure><p><br>&nbsp;</p><p>&nbsp;</p><p>그럼 점수는 어떻게 내느냐.</p><p>&nbsp;</p><p>3종류가 있습니다.</p><p>&nbsp;</p><p>&nbsp;</p><figure class="image"><img src="https://cf.geekdo-images.com/imagepage/img/3dE9kv1Cchc2HDKDet6FFfYfbsc=/fit-in/900x600/filters:no_upscale()/pic4963555.jpg" alt="Calico prototype"></figure><p><br>&nbsp;</p><p>첫번째로 고양이 점수.</p><p>&nbsp;</p><p>매 게임마다 랜덤으로 고양이 미션이 결정되는데, 각 고양이마다 선호하는 문양과 배치형태가 있습니다.</p><p>타일을 깐 직후 해당조건을 만족시키면 그 고양이가 와서 배를 깔고 드러눕습니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>두번째는 색깔 점수.</p><p>&nbsp;</p><p>타일을 깐 직후, 같은 색깔의 타일이 3개 이상 붙어있다면 그룹을 형성하게 되고, 해당 색상의 토큰을 가져옵니다.</p><p>이미 색상토큰이 있는 그룹은 더 이상 색상토큰을 가질 수 없으니 확장을 해도 의미가 없습니다.</p><p>모든 색상의 토큰을 가지게 되면 무지개색 토큰을 보너스로 받습니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>세번째는 개인 미션 점수.</p><p>매 게임마다 랜덤을 개인 미션 타일을 배치해서 해당 조건을 충족하면 점수를 받을 수 있습니다.</p><p>각 미션 타일의 주위 6칸에 해당 미션이 요구하는 타일들을 배치하면 됩니다.</p><p>조건은 색상 또는 문양으로 맞춰줘야 되는데, 둘다 충족하면 큰 점수, 둘 중 하나만 만족하면 작은 점수를 받습니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>게임은 모든 플레이어가 개인판을 다 채우면 끝납니다. 개인판마다 테두리에 배치된 타일이 다른데, 이 테두리에 이미 존재하는 타일들도 고양이 조건과 색깔 조건을 만족시키는데 이용가능합니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>룰 설명은 이 정도?</p><p>&nbsp;</p><p>&nbsp;</p><p>2인플로 플레이 했었는데, 인원수에 따른 차이가 그렇게 크지는 않아서 어느 인원수로 해도 괜찮을 것 같았습니다.</p><p>같이 플레이 했던 멤버의 소감으로는, ''이게 웨이트 1점대라니 믿을 수 없어! 크아아앙!''&nbsp;</p><p>이라고 하네요.</p><p>&nbsp;</p><p>귀여움으로 무장한 룰은 간단한 퍼즐게임이지만 장고성향이 높은 플레이어와는 그다지 권하고 싶지 않습니다.</p>',to_date('20/04/21','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),4,0,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (104,116,6,'간략후기(사진없음)','<p><span style="color:rgb(0,0,0);">이번에 버라지와 함께 받은 뉴턴 미니(?)확장의</span><br><span style="color:rgb(0,0,0);">간단한 플레이 후기 입니다 ㅎ</span><br><span style="color:rgb(0,0,0);">저는 쓸데가 없는 레이크홀트 프로모가 들어있더군요 ㅎ</span><br><br><span style="color:rgb(0,0,0);">정말 오랜만에 아내와 2인플을 했는데 확장은 큰변화는</span><br><span style="color:rgb(0,0,0);">없었습니다.</span><br><br><span style="color:rgb(0,0,0);">1. 추가된 카드.</span><br><span style="color:rgb(0,0,0);">심볼이 2개가 있는 녀석은 매우 좋구요</span><br><span style="color:rgb(0,0,0);">심벌이 둘중하나 선택하는것도 좋습니다 ㅎ</span><br><span style="color:rgb(0,0,0);">책상밑에 넣어두면 그 칸을 사용할때 발동되는 특수카드는</span><br><span style="color:rgb(0,0,0);">뭔가 쬐~끔 애매해서 사용하시는분의 실력에 따라</span><br><span style="color:rgb(0,0,0);">편차가 클수도 있겠더군요</span><br><br><span style="color:rgb(0,0,0);">2. 빠른액션으로 구매해오는 타일.</span><br><span style="color:rgb(0,0,0);">책을 주거나 수입으로 돈이나 시약병을 줍니다.</span><br><span style="color:rgb(0,0,0);">그리고 게임동안 내가 달리지 않았던 테크에서 점수를</span><br><span style="color:rgb(0,0,0);">쬐~끔 줍니다.</span><br><span style="color:rgb(0,0,0);">보통 게임은 달리는것을 지원해주는 점수타일이 들어있는데</span><br><span style="color:rgb(0,0,0);">이건 아무것도 안한것에 대한 점수를 주네요ㅎ</span><br><br><span style="color:rgb(0,0,0);">그래서 모두 끼워넣고 플레이를 했는데</span><br><span style="color:rgb(0,0,0);">전에는 대략 2가지 분야를 top을 찍었었는데</span><br><span style="color:rgb(0,0,0);">심볼이 더 생기고 능력이 좋아지니 3~4가지를 top찍을수</span><br><span style="color:rgb(0,0,0);">있게되네요 ㅎ 점수도 100점이 쉽게 넘습니다.</span><br><br><span style="color:rgb(0,0,0);">요런방식은 호불호가 갈릴수도 있지만 저는 풍족해서 좋았습니다. 마지막 라운드 마지막턴은 더 할수있는게 없더군요</span><br><br><span style="color:rgb(0,0,0);">뉴턴은 적은 인터렉션으로 인해 쬐~끔 아쉬웠는데</span><br><span style="color:rgb(0,0,0);">거기에 대한 보정은 없었다는게 이번에도 아쉽네요 ㅜㅠ</span><br><span style="color:rgb(0,0,0);">그래도 재밋었네요 ㅎ 점수는 잘 안매기지만..</span><br><span style="color:rgb(0,0,0);">7.0짜리 게임이 7.3정도로 올라갈수있는 확장이었습니다.</span></p>',to_date('20/04/21','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),5,0,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (105,113,14,'최근 2인플 후기 (데이터 주의)','<p>안녕하세요. 오랜만에 올려보는 2인플 간단 후기입니다.</p><p>사회적 거리두기가 본격화되기 전에 방문했던 보드카페를 제외하고&nbsp;모두 집에서 플레이했습니다.</p><p>&nbsp;</p><p><strong>1. 초콜릿 팩토리</strong></p><figure class="image"><img src="http://boardlife.co.kr/wys2/file_attach/2020/04/17/1587130784_64206.jpg" alt=""></figure><p><br>&nbsp;</p><p>초콜릿 공장을 운영하는 테마의 엔진빌딩형&nbsp;게임입니다. 컨베이어 벨트에 재료를 싣고 한 칸씩 이동하면서, 위/아래의 부품&nbsp;액션으로 초콜릿을 생산하고 골목가게나 백화점에 납품하는 흐름으로 진행됩니다.&nbsp;아트워크도 좋고 컴포넌트가 예뻐서 눈이&nbsp;참 즐거웠어요. 디럭스 버전도 있긴 하지만(선&amp;라운드 목재 마커, 부품 카드를 타일로 업그레이드 등), 리테일판으로 즐겨도 큰 아쉬움은 없으실 겁니다.</p><p>다만&nbsp;인터액션이 정말 미미한 수준이라&nbsp;저희 커플 취향과는 약간 안 맞았네요. 직원/부품 카드 드래프트와 백화점 납품 경쟁이 있긴 하지만 별로 치열하지 않고&nbsp;혼자 하는 느낌이 매우 강했습니다. 점점 상대가 뭘 하든&nbsp;관심이 안 가고 각자 개인보드만 골똘히 들여다보게 되더라고요. 하지만 취향의 문제일 뿐 제법 준수한 게임입니다.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>2. 핀카 (+엘 라줄 확장)</strong></p><figure class="image"><img src="http://boardlife.co.kr/wys2/file_attach/2020/04/17/1587131986_84131.jpg" alt=""></figure><p><br><br>둘이 이미 20판 가까이&nbsp;했을&nbsp;정도로 좋아하는 게임인데, 이번에 나온 한글판(재판 버전)으로 다시 즐겨봤습니다. 엘 라줄 확장은 처음 넣고 해봤어요.</p><p>규칙은 그대로일 줄 알았는데&nbsp;중요한 변화가 있더군요. 초판과 달리 재판에선&nbsp;인원 수에 따라 사용하는 과일의 수가 달라집니다. 그래서 한 사람이 최대로 보유 가능한&nbsp;과일의 수가 적어지기 때문에 계속 과일만 모으고 있을 순 없어요.&nbsp;게다가 엘 라줄 확장의&nbsp;가뭄까지 일어나면 한 사람이 과일을 최대 5개까지만 가질 수 있게 돼서(2인플 기준) 견제가 더욱&nbsp;심해집니다. 어그로를 끌기 쉬워서&nbsp;게임의 긴장감이 한층 높아졌어요 ㅋㅋ&nbsp;좋은 변화라고&nbsp;생각합니다.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>3. 시에라 웨스트</strong></p><figure class="image"><img src="http://boardlife.co.kr/wys2/file_attach/2020/04/17/1587133113_48077.jpg" alt=""></figure><p><br><br>서부 개척 시대 테마가 담긴&nbsp;네 가지 모듈을 즐겨볼 수 있는 게임이죠. 이날은 골드 러시 모듈로 진행했어요. 매 턴마다 카드 세 장을&nbsp;겹쳐서 배치한 후 공개된 아이콘의 액션을 수행하는 기본 규칙은 동일하되, 골드 러시 모듈에는 광차에 금을 싣는 액션이&nbsp;있어서 금이 매우 중요해집니다.</p><p>카드를 어떻게 배치할지 요리조리 고민하는 브레인 버닝&nbsp;요소가 강한데, (초콜릿 팩토리보단 낫긴 해도)&nbsp;역시 인터액션이&nbsp;적은&nbsp;편이라 아쉬움이 있습니다.&nbsp;다만 1인플은 매우 추천 드립니다. 오토마와 대결하는 방식인데 다인플 못지 않은 것 같아요.</p>',to_date('20/04/21','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),14,0,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (106,114,7,'프라이데이 레벨1 처음 깬 날','<p>2F 님의 &lt;프라이데이&gt; 레벨1 처음으로 깬 기록입니다.</p><p>&nbsp;</p><p>룰북에 진짜 게임은 레벨4부터라고 써있던데 레벨1부터&nbsp;왜이리 어려운지, 첫 판에 -33점, 둘째 판에 -52점 먹고나서&nbsp;잠시 무기력한 로빈슨 상태&nbsp;빙의...</p><p>&nbsp;</p><p>그러다가 드디어 어제 해적 둘을 물리치고 처음으로 로빈슨을 돌려보냈네요. 프라이데이에게 평화를! :)</p><p>&nbsp;</p><p>이번에 물리친 해적은 요 두 놈입니다. 두 놈 모두 특수능력은 없는 놈들이라&nbsp;왕초보 로빈슨에게는 다행이었죠.</p><figure class="image"><img src="http://boardlife.co.kr/wys2/file_attach/2020/04/21/1587451862_11128.jpg" alt=""></figure><p><br>&nbsp;</p><p>&nbsp;</p><p>겁쟁이&nbsp;로빈슨은 그나마 약해보이는&nbsp;전투력 25짜리부터 상대하기로 마음 먹습니다.<br>&nbsp;</p><figure class="image"><img src="http://boardlife.co.kr/wys2/file_attach/2020/04/21/1587452321_18977.jpg" alt=""></figure><p><br>&nbsp;</p><p>(전투의 흔적만 남을 뿐 어떤 순서로 어떻게 싸웠는지는 1도 기억나지 않는다...) 어쨌든 그동안 갈고 닦은 능력들&nbsp;모아&nbsp;모아서 27:25로 무찔렀습니다!</p><p>&nbsp;</p><p>이제 진짜 끝판왕 전투력 35짜리...</p>',to_date('20/04/21','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),5,1,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (107,101,8,'제2차 세계대전을 그대로 담은 희대의 역작, Absolute Victory 후기','<p><br>&nbsp;</p><figure class="image"><img src="http://boardlife.co.kr/wys2/file_attach/2020/04/19/1587241837_90412.jpg" alt=""></figure><p><br>&nbsp;</p><p><strong>Absolute Victory의 각 지역별 지도는 지도 A, B, C, 그리고 남극으로 구성되어 있습니다. 각 헥스는 색과 기호가 다양하지만, 생각보다 파악하는 것이 어렵지는 않습니다.</strong></p><p>&nbsp;</p><p>다른 보드워게임과 다른 Absolute Victory의 가장 큰 특징은 전투 방식과 이벤트입니다. 여타 보드워게임들은 보통 전투가 벌어지면 각 유닛들의 전투력과 전투력에 보정되는 값을 합산하고, 그것을 기준으로 주사위를 굴려서 적에게 줄 피해량을 결정합니다. 하지만 이 게임은 그렇게 간단하게 전투가 끝나지 않고, 전투에 영향을 미치는 다양한 선택과 전력 투사를 통해 전투를 진행합니다. 한 스택(유닛들의 모음)이 적 스택이 존재하는 헥스(=도시, 공장, 숲, 사막 등)로 진입하면 전투가 벌어집니다. 전투가 벌어지면 먼저 각자의 스택에 있는 병력을 전선에 배치하고, 남은 병력을 예비대(후방)로 배치합니다. 전선은 총 12칸으로 구성되어 있으며, 사령부와 전차는 1칸을 차지하고 보병은 2칸을 차지합니다. 스택에 아무리 병력이 많아도 전투에 참여할 수 있는 병력은 오직 전선에 배치된 병력 뿐입니다. 이러한 전선 너비는 이론상 최대 6개의 보병 유닛을 배치하거나, 또는 12개의 전차 유닛을 배치할 수 있습니다.</p><p>&nbsp;</p><p>&nbsp;전선에 병력을 다 배치하면, 공군을 투입합니다. 이 게임의 공군은 추상적으로 표현되었고, 전선에 배치한 유닛이 공군기지 역할을 합니다. 공군은 전선에 배치된 육군 유닛 1개마다 1기씩 전투에 투입할 수 있습니다. 자신과 상대가 동시에 공군 투입을 결정하면, 먼저 제공권을 결정합니다. 제공권에는 더 적은 공군을 투입한 쪽의 공군 숫자만큼 각자의 공군을 제공권 확보를 위해 투입합니다. 만약 내가 7개의 공군을 투입하고, 적이 5개의 공군을 투입했으면 각자 5개의 공군은 제공권 확보를 위해 공중전을 벌이고, 나머지 2개의 공군은 적의 대공 임무로부터 자유롭게 적 육군에 대해 공습을 수행할 수 있습니다. 공중전에서 공군이 살아남아도 공습에 투입할 수는 없으며, 오직 제공 임무에 투입되지 않은 남은 공군만이 공습을 수행할 수 있습니다.</p><p>&nbsp;</p><p>육군에 대한 공군의 전술공습은 잘 선택되어야 합니다. 전술공습이 성공하며 피해를 입은 적은 "약화"됩니다. 하지만, 육군은 전투 중에 자신이 감당할 수 있는 피해량보다 더 많은 피해를 입으면 "전사"합니다. 각 국가는 모집 단계 동안 모집할 수 있는 보병의 숫자가 정해져 있는데, 신규 보병 1개를 모집하는 대신에 약화된 보병 3개를 재편성할 수 있습니다. 만약 전술공습의 성공으로 적 병력이 피해를 입으면, 전사하는 것이 아니라 약화되는 것이기 때문에 다음 턴에 손쉽게 피해를 회복하고 전선에 배치될 수 있습니다.</p><p>&nbsp;</p>',to_date('20/04/21','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),11,0,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (108,81,9,' 게임은 나름대로 많은 것을 구현하고자 했습니다.','<p>술공습이 종료되면 이 전투가 상륙강습에 의해 벌어진 전투일 때는 해안포격을 개시하고, 그렇지 않으면 본격적인 전투를 개시합니다(아쉽게도 이번 플레이 동안 해안포격과 해전은 경험해보지 못했습니다. 독일과 이탈리아 해군 전력으로 감히 영국과 미국의 해군 전력에 대항할 엄두가 나질 않았습니다). 전투가 시작되면 양측은 전투 모드를 결정합니다. 공격자는 전격전, 정면공격, 통상공격, 야간공격, 견제공격을 선택할 수 있고, 방어자는 반격, 절대사수, 균형방어, 종심방어, 전술적 퇴각을 선택할 수 있습니다.</p><p>&nbsp;</p><p>&nbsp;먼저 공격자의 전술에서 느낀 점을 말씀드리겠습니다. 전격전은 피해를 받을 확률이 증가하지만, 동시에 적에게 피해를 줄 확률도 증가하며, 전투가 종료되어도 계속해서 이동하고 적을 공격할 수 있습니다(이 게임은 대체로 한 번 전투를 수행하면, 이어서 전투와 공격을 수행할 수 없습니다). 정면공격은 적당한 피해를 받으면서 동시에 적에게도 나름의 피해를 줄 수 있습니다. 하지만 적의 공격이 성공했을 때, 아군 전체가 전투가 종료된 후에도 이동하여 전투할 수가 없다보니 기동전을 수행하기에는 무리가 있습니다. 통상공격은 균형적인 공격입니다. 서로 평균적인 피해만을 주고 받는 정도입니다. 보신을 원한다면 통상공격을 선택할 수 있겠습니다. 야간공격은 서로 피해를 주기 어렵지만, 대신에 적의 지형적인 이점을 무시하는 등 기타 이점을 활용하여 적을 밀어내고자 하는 방법입니다. 마지막으로 견제공격은 적의 공군을 소모시키기 위해 미끼용으로 공격하거나 적의 전력 수준을 파악하기 위해 수행하는 미약한 공격입니다.</p><p>&nbsp;</p><p>&nbsp;방어자의 전술에서 반격은 대체로 공격자의 선공을 내주는 편입니다. 공격자에게 먼저 피해를 입고, 피해를 적용한 이후에 방어자가 공격을 수행하는 것입니다. 언뜻보면 마냥 좋지 않은 전술이지만, 적에게 피해를 입힐 확률이 높다는 점에서 한번쯤 시도해볼 수 있는 도박일 수 있습니다. 절대사수는 전선을 굳게 방어하여 전선에 구멍을 만들지 않고, 절대로 퇴각하지 않으며 죽을 때까지 싸우는 전술입니다. 서로 피해량은 많지만, 방어자가 퇴각할 확률이 크게 줄어듭니다. 균형방어는 통상공격과 유사하게 서로 평균적인 피해를 주고 받는 정도입니다. 종심방어는 적에게 받는 피해량을 감소시키고 지연전을 이끌어내기 위해 사용하는 전술입니다. 마지막으로 전술적 퇴각은 방어 병력이 이번 전투가 종료된 후 높은 확률로 퇴각하는 대신에 서로에게 피해를 거의 주지 않도록 하는 전술입니다.</p><p>&nbsp;</p><figure class="image"><img src="http://boardlife.co.kr/wys2/file_attach/2020/04/19/1587241855_12377.jpg" alt=""></figure><p><br><br>&nbsp;</p><figure class="image"><img src="http://boardlife.co.kr/wys2/file_attach/2020/04/19/1587241865_93220.jpg" alt=""></figure>',to_date('20/04/21','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),7,2,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (109,113,123,'왜이래요 여기?','<p>너무 좋아요</p>',to_date('20/04/21','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),8,0,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (17,1,2,'간단한 후기 ','<p>4인 팟이 모여서 다과회에 이어서 차를 만드는 차이를 시작했습니다.</p><p>이날의 기대작. 이쁘긴 너무 이쁜데 생각보다 너무 가벼운 게임이네요.</p><p>재료를 모아 차를 만들면 됩니다. 게임 운영에 큰 어려움이 없고 상호작용이 심하지도 않아 큰 고민없이 가볍게 즐길 게임입니다.</p><p>다음 플레이에서는 변형 규칙을 도입해서 난이도를 올려보고 싶네요.</p><p>&nbsp;</p><p><br>&nbsp;</p><figure class="image"><img src="http://boardlife.co.kr/wys2/swf_upload/2020/04/16/15870432042750.jpg"></figure><p><br>&nbsp;</p><p>&nbsp;</p><p>우리들의 여름방학!!</p><p>눈치싸움이 기가 막힙니다.</p><p>숙제를 미루고 미루다가 방학이 끝나갈때 허둥지둥 하게되는 것은 당연한 일이지요.</p><p><br>&nbsp;</p><figure class="image"><img src="http://boardlife.co.kr/wys2/swf_upload/2020/04/16/15870432048368.jpg"></figure><p><br>&nbsp;</p><p>&nbsp;</p><p>트랩워드.</p><p>상대가 설명에 쓸것 같은 단어를 예상해 함정을 파두는 게임이죠.</p><p>설명을 시작한 첫 단어에 바로 걸려서 빵 터졌습니다.</p><p>팀전 단어게임은 코드네임, 디크립토가 자주 돌아가다 최근엔 트랩워드가 주로 돌아가고 있네요.</p>',to_date('20/04/01','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),6,0,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (18,1,12,'올다 언더월드 , LOTR 후기입니다 ! ','<p>언더월드 지난주 엉망진창 튜토 받고 이번에 본격적으로 해봤습니다</p><p>&nbsp;</p><figure class="image"><img src="https://1.bp.blogspot.com/-mEWqYCaTeQ8/Xpb5MeYaA3I/AAAAAAAAG8U/0iE0jIWaUvoXGQeCB7RZynyKLl0tZ6j8gCLcBGAsYHQ/s1600/IMG_1597.JPG"></figure><p><br>&nbsp;</p><p><br>흐로스곤 첫 핸드<br>나름 나쁘지 않게 나왔네요<br>&nbsp;</p><figure class="image"><img src="https://1.bp.blogspot.com/-DWgDaP1mIzw/Xpb5MTi1RbI/AAAAAAAAG8Y/c5zjpdnsuBUsbfwSMR_GVmNlkLLuuu-0wCLcBGAsYHQ/s640/IMG_1598.JPG"></figure><p><br>&nbsp;</p><p><br>상대는 자르백<br>배치는 이렇게 시작합니다<br>&nbsp;</p><figure class="image"><img src="https://1.bp.blogspot.com/-8sbDYXxFSkU/Xpb5Mqs9_3I/AAAAAAAAG8c/3GR9TPGWJgsHp_vuiz_gigQO001zBf0qgCLcBGAsYHQ/s640/IMG_1599.JPG"></figure><p><br>&nbsp;</p><p><br>1턴 종료</p>',to_date('20/04/01','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),19,1,0,0,11);
Insert into DB_SAWEE.CAFE_REVIEW (CR_NO,C_NO,M_NO,CR_TITLE,CR_CONTENT,CR_WRITTEN_DATE,CR_UPDATED_DATE,CR_HIT,CR_RECOMMEND_NUM,CR_REPORT_NUM,CR_ISLAND,BT_NO) values (13,1,5,'팬레1을 마치고 팬레2를 시작했습니다.','<p><span style="color:rgb(0,0,0);">안녕하세요.</span><br><br><span style="color:rgb(0,0,0);">올해 팬레1을 해봐야지 했는데 코로나가 터지고</span><br><span style="color:rgb(0,0,0);">강제로 집에서 얼마전에 팬레1을 완료했습니다.</span><br><br><span style="color:rgb(0,0,0);">너무 재밌게 했고, 보드게임에 큰 관심이 없었던 둘째까지 함께해서 너무 좋았습니다.</span><br><br><span style="color:rgb(0,0,0);">그리고 여러분들의 성원에 힘잎어 팬레2를 어렵게 중고로 구매했고</span><br><span style="color:rgb(0,0,0);">드디어 드디어 오늘 플레이를 했습니다.</span><br><br><span style="color:rgb(0,0,0);">팬레1과 비슷하면 지겹지 않을까 생각했는데</span><br><span style="color:rgb(0,0,0);">해보니 플레이어가 할 수 있는 행동이 많이 달라졌네요.</span><br><br><span style="color:rgb(0,0,0);">아이들도 너무 재밌어하네요.</span><br><span style="color:rgb(0,0,0);">프롤로그만했는데도 게임이 쉽지않겠다라는 생각이 듭니다.</span><br><span style="color:rgb(0,0,0);">앞으로 너무 기대가 되네요.</span><br><br><span style="color:rgb(0,0,0);">다들 아직 세상은 위험하니 나가지 마시고</span><br><span style="color:rgb(0,0,0);">집에서 보드게임 즐겨보아요. ^^</span></p>',to_date('20/04/01','RR/MM/DD'),to_date('20/04/21','RR/MM/DD'),21,1,0,0,11);
