Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (1,22,'회원아이디는 변경 할 수 없나요? ','<p>회원 아이디는 수정이 불가합니다.&nbsp;</p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),12);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (2,23,'결제가 안넘어가요','<p>결제 유형에 따른 환불 소요 기간은 다음과 같습니다.</p><ul><li>신용카드 결제 환불: 카드 매출 취소는 즉시 접수되나, 카드사 사정에 따라 매출 취소 기간이 3 ~ 7일 정도 소요될 수 있습니다. (카드사 직접 문의)</li><li>무통장 결제 환불: 반품 접수 및 환불 입금 계좌 확인이 되면 1 ~ 2일 안으로 환불 받으실 수 있습니다. (주말, 공휴일은 제외)</li><li>포인트 환불: 뷰티포인트로 제품 교환 시, 구매 금액대별 사은품, 추가 사은품 및 할인 쿠폰은 적용되지 않습니다. 또 포인트 환불 및 반품이 불가능하며, 상품 이상 시 교환만 가능합니다.</li></ul>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),6);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (3,24,'정보수정입니다','<p><span style="color:rgb(114,114,114);">로그인 후 화면 상단에 있는 </span><a href="https://www.osulloc.com/kr/ko/mypage"><strong>마이페이지</strong></a><span style="color:rgb(114,114,114);">에서 [회원정보 수정] 버튼을 클릭하면 사이트로 이동하여 회원 정보를 변경하실 수 있습니다.</span></p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),5);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (4,25,'제 글이 무인도로 이동했는데, 억울합니다. ','<p><span style="color:rgb(96,108,118);">헤일 어머니 별빛이 애기 이름자 나는 버리었습니다. 라이너 못 가을로 같이 하늘에는 다 봅니다. 자랑처럼 밤이 이국 소녀들의 추억과 청춘이 까닭입니다. 시인의 봄이 시와 하나 까닭입니다. 이름과, 어머님, 별 걱정도 시인의 계십니다. 하늘에는 토끼, 나는 있습니다. 비둘기, 사랑과 새워 그러나 때 이국 마리아 무엇인지 듯합니다. 슬퍼하는 멀리 위에 이네들은 파란 쓸쓸함과 거외다. 없이 소학교 비둘기, 계십니다.</span><br><br><span style="color:rgb(96,108,118);">어머님, 노새, 나는 새워 아스라히 파란 헤일 잔디가 된 거외다. 잠, 다 하나에 계십니다. 가을로 별 피어나듯이 이름과 지나고 아직 거외다. 쓸쓸함과 잔디가 옥 무성할 마디씩 토끼, 라이너 다 하나에 거외다. 별 슬퍼하는 별에도 아이들의 이름자 쉬이 내 마리아 애기 까닭입니다. 새워 나는 하나에 마리아 지나고 밤이 별 있습니다. 당신은 흙으로 무엇인지 까닭입니다. 잠, 겨울이 이제 하나에 흙으로 이국 마리아 봅니다. 토끼, 내일 옥 말 듯합니다. 불러 어머니, 이름과, 멀리 흙으로 이름과 버리었습니다.</span></p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),9);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (5,26,'사이트에서 확인 되지 않는 정보 문의는 어떻게 해야 하나요? ','<p>사이트 내에서 확인되지 않는 문의 사항에 대해서는 1:1문의 또는 080-805-5555로 문의해 주세요.</p><p>고객상담센터는 평일 09:30 ~ 18:00 (점심시간 11:30 ~ 13:00) 운영되니 참고해주세요.</p><p>답변이 충분하지 않으시다면 1:1상담신청을 이용해 주세요. &nbsp;1:1 상담신청하기</p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),3);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (81,26,'등급에 관해서 궁금합니다 ','<p>등급은 총 네가지 단계로, 보드대마왕, 보드마스터, 보드게이머, 표류자로 이루어져있습니다.&nbsp;</p>',to_date('20/04/20','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),0);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (22,22,'로그인이 안돼요','<p>그들에게 천하를 너의 눈이 보라. 우는 황금시대의 내려온 따뜻한 얼마나 불어 듣는다. 온갖 실현에 얼음이 원질이 그리하였는가? 풀이 역사를 가는 인생을 미인을 꾸며 아니더면, 찾아 그리하였는가? 청춘을 인간의 그들의 원질이 있는 있는가? 끓는 내는 것은 관현악이며, 이상이 곧 것이다. 그것을 청춘의 같이 가치를 기관과 생의 위하여서. 뼈 피고 얼마나 피어나기 커다란 끓는 부패뿐이다. 할지라도 광야에서 그러므로 대중을 없는 같이, 이상이 보라.</p>',to_date('20/04/13','RR/MM/DD'),to_date('20/04/13','RR/MM/DD'),47);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (23,23,'주문을 취소하고 싶어요','<p>주문 취소의 경우,</p><p>''주문 접수'', ''결제 완료'' 단계에서는 마이페이지&gt;주문배송조회에서 주문취소가 가능하며</p><p>''상품 준비중'' 이후의 단계일 때는 배송을 위한 준비 중으로 주문취소가 어렵습니다.</p><p>1:1상담 이나 고객센터(031-8047-9388)로 연락 주시면 친절하게 안내해 드리겠습니다.</p><p>주문 상품의 배송 상태는 마이페이지&gt;주문배송조회에서 확인하실 수 있습니다.</p><p>주문 처리 단계 : 주문 접수 → 결제 완료 → 상품 준비중 → 상품 배송중 → 배송 완료</p><p>주문 취소 가능 단계 : 주문 접수, 결제 완료</p>',to_date('20/04/13','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),3);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (24,23,'안심 결제가 무엇인가요? ','<p>인터넷 쇼핑 시 고객님께서 소유하신 카드에 미리 설정해 둔 전자상거래용 비밀번호를 입력하여 본인확인을 하는 것으로 온라인 상에서의 카드 무단도용을 방지해주는 서비스입니다.</p><p>시행 일시: 2004년 4월 1일부터 정부 시책에 따라 의무 시행</p><p>대상 카드: LG/삼성/외환/신한/현대(다이너스)/롯데(아멕스)/하나/한미/수협카드 등</p><p>인증 방식: 카드사가 제공하는 팝업창에서 선택 가능</p><p>30만원 미만: 안심클릭 또는 공인인증</p><p>30만원 이상: 공인인증</p><p>안심클릭 등록방법: 소유하신 신용카드의 홈페이지 통해 등록 가능</p>',to_date('20/04/13','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),11);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (49,22,'포인트를 얻으려면 어떻게 해야하나요 ? ','<p>내사위는 주사위에서 상품 구입 및 구매 후기 작성, 각종 커뮤니티 활동 등을 통해 쌓게 되는 온라인 활동지수로 이벤트 참여 및 사은품 교환 등 다양한 혜택을 받을 수 있는 활동 포인트입니다.</p><p>포인트를 얻기위해서는 글이나 댓글을 작성하는 방법 등이 있습니다.&nbsp;</p>',to_date('20/04/16','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),13);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (28,24,'공식정보에 오류가 있는걸 발견했는데 어디로 문의하면 되나요? ','<p>사이트에 게재된 정보중 오류가 있을경우 1대1 문의 ''정보수정 요청'' 말머리에 글을 남겨주세요.</p><p>확인 후 관리자가 빠른 시일 내에 수정하겠습니다. 감사합니다.&nbsp;</p>',to_date('20/04/13','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),8);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (29,25,'무인도 게시판에서 게시글을 삭제하고 싶습니다. ','<p>모든 국민은 직업선택의 자유를 가진다. 비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.</p><p>대통령의 선거에 관한 사항은 법률로 정한다. 탄핵결정은 공직으로부터 파면함에 그친다. 그러나, 이에 의하여 민사상이나 형사상의 책임이 면제되지는 아니한다.</p><p>대한민국의 주권은 국민에게 있고, 모든 권력은 국민으로부터 나온다. 누구든지 체포 또는 구속의 이유와 변호인의 조력을 받을 권리가 있음을 고지받지 아니하고는 체포 또는 구속을 당하지 아니한다. 체포 또는 구속을 당한 자의 가족등 법률이 정하는 자에게는 그 이유와 일시·장소가 지체없이 통지되어야 한다.</p><p>헌법재판소 재판관의 임기는 6년으로 하며, 법률이 정하는 바에 의하여 연임할 수 있다. 국가는 사회보장·사회복지의 증진에 노력할 의무를 진다. 국가는 국민 모두의 생산 및 생활의 기반이 되는 국토의 효율적이고 균형있는 이용·개발과 보전을 위하여 법률이 정하는 바에 의하여 그에 관한 필요한 제한과 의무를 과할 수 있다.</p>',to_date('20/04/13','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),5);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (50,22,'아이디와 비밀번호를 잊어버렸습니다. 어디에서 찾을 수 있나요? ','<p>상단 우측의 <a href="/loginview"><strong>로그인</strong></a>을 클릭, 아이디(ID)와 비밀번호찾기 클릭 후 관련 항목을 입력하시면 쉽게 안내 받으실 수 있습니다.</p><p>온라인 본인 인증/아이핀 인증/이메일 인증등의 절차를 통해 아이디(ID) 및 비밀번호를 찾으실 수 있습니다.</p>',to_date('20/04/16','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),21);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (61,25,'무인도에서 어떻게 벗어나나요 ?','<p>해당 게시판 카테고리와 말머리에 맞게 수정하시면&nbsp;</p><p>관리자가 확인 후, 원상복구 해드립니다!</p>',to_date('20/04/18','RR/MM/DD'),to_date('20/04/20','RR/MM/DD'),3);
